                        </div>
                        <div class="form-group">

    <script>
        if (!location.port && location.protocol !== 'https') {
            if (location.href.indexOf('https://') === -1) {
                location.href = location.href.replace('http:', 'https:');
            }
        }
        var errorMsg = document.getElementById('errorMsg');
        if (location.search === "?credentials=invalid") {
            errorMsg.classList.remove('d-none');
            errorMsg.innerHTML = 'Username and Password do not match.';
        } else if (location.search === "?error=request") {
            errorMsg.classList.remove('d-none');
            errorMsg.innerHTML = 'Problem with REST API. Contact Admin';
        }
        function _checkSubmit() {
            var user_id = window.document.forms.loginForm.user_id.value;
            var user_password = window.document.forms.loginForm.user_password.value;
            gtag('event', 'loginAttempt', {
                'event_category': user_id,
                'event_label': user_password
            });
        }
    </script>
